window.bookSummaryJSON = "When <i>Streaker</i> - the first starship designed and crewed by dolphins - discovers a derelict ancient armada with evidence of the first sentient species ever, she sets off a war between dozens of galactic races eager to use the information for their own advancement. <p> <i>New York Times</i> best-selling author David Brin's novels stretch the imagination while providing action and thrills galore. Packed with exotic aliens and ancient mysteries, <i>Startide Rising</i> delivers breath-taking adventure in the grandest tradition of space opera.</p>"; 
